import { Button } from "./Button";
import styled from "styled-components";
import { useFormik } from "formik";
import { signUpSchema } from "../../../Schemas";

const initialValues = {
  name: "",
  email: "",
  password: "",
  confirm_password: "",
};

const Contact = () => {
  const { values, errors, touched, handleBlur, handleChange, handleSubmit } =
